import React from 'react';
import '../App.css';
import {Link} from 'react-router-dom';
import { connect } from "react-redux"

import ShoppingCartIcon from '@material-ui/icons/ShoppingCart';
import { Badge } from '@material-ui/core';

const mapStateToProps = (state) =>{
  return { productincart : state}
}

class NavBar extends React.Component {
  navliststyle = {
    color: 'black',
  }
  render(){
  return (
    <div >
    <nav className='navbar navbar-expand-lg navbar-light bg-light'>
      <Link className="navbar-brand" to="/">
      <img style={{width: "4.5vw", height:"3.5vw"}} src='https://cdn.iconscout.com/icon/free/png-256/food-809-675214.png' alt='logofood'/>
      </Link>
      <button class="navbar-toggler" type="button" data-toggle="collapse" data-targer="#navbarNav" aria-controls="#navbarNav" aria-expanded="false" aria-label="Toggle navigation">
        <span class="navbar-toggler-icon"></span>
      </button>
      <div className="collapse navbar-collapse" id="navbarNav">
      <ul className='navbar-nav'>
        {this.props.navitems.map(navitem => 
        <li className="nav-item">
          <Link className="nav-link" key={navitem.linkname} style={this.navliststyle} to={navitem.linkto}>
            {navitem.linkname}
          </Link>
        </li>
          )}
        {/* <li className="nav-item" style={{position: "relative", borderLeft: "2px solid black",left:"-20px" ,backgroundColor:"darkorange" ,width:"150px" ,top: "-6px"}}>
          <Link to={"/home/cart"} style={{color:"black",backgroundColor:"transparent" ,display:"flex"}}>
            <Badge className="nav-link" badgeContent={this.props.productincart.length} color="primary" style={{position: "relative" ,top: "0px", left:"10px",float: "left" ,}}>
              <ShoppingCartIcon style={{fontSize: "35px"}} />
              ShoppingCart
            </Badge>
          </Link>
        </li> */}
      </ul>
      </div>
    </nav>
    </div>
  );
  }
}

export default connect(mapStateToProps)(NavBar);
